import React from 'react';
import { GoogleLogin } from 'react-google-login';
import { useHistory } from 'react-router-dom';
import Form from "react-bootstrap/Form";
import Button from "react-bootstrap/Button"


const Login = () => {
    
        
    const history = useHistory();
    const googleSuccess = async (response) => {
        console.log(response);
        history.push('/')
        alert('Login feito com sucesso')
    }
    const googleFailure = (error) => {
        console.log(error)
        console.log("Google error");
        
    }
    return (
        
        
        <section className="login">
         
            <div class="row">
                <div class="col-sm-9 col-md-7 col-lg-5 mx-auto">
                    <div class="card card-signin my-5">
                        <div class="card-body">
                            <h5 class="card-title text-center">Sign In</h5>
                            <form class="form-signin">
                            <div class="form-label-group">
                <input type="email" id="inputEmail" class="form-control" placeholder="Email address" required autofocus></input>
                <label for="inputEmail">Email address</label>
              </div>

              <div class="form-label-group">
                <input type="password" id="inputPassword" class="form-control" placeholder="Password" required></input>
                <label for="inputPassword">Password</label>
              </div>

              <div class="custom-control custom-checkbox mb-3">
                <input type="checkbox" class="custom-control-input" id="customCheck1"></input>
                <label class="custom-control-label" for="customCheck1">Remember password</label>
              </div>
              <button class="btn btn-lg btn-primary btn-block text-uppercase" type="submit">Sign in</button>
              
              <div className="btn btn-lg btn-google btn-block text-uppercase" type="submit">
              <GoogleLogin 
                            clientId="83656149699-rdikfecitstoasn830p37kehfv6evojs.apps.googleusercontent.com"    
                            buttonText="Login with Google" 
                            onSuccess={googleSuccess}
                            onFailure={googleFailure}
                            cookiePolicy="single_host_origin"
                            isSignedIn={true}
                />
                </div>
              
            </form>
          </div>
        </div>
      </div>
    </div>
  
                    
                        
                  
            
        </section>
        
    )
}

export default Login
